// This function removes leading and trailing quotes from strings
// as well as the escape sequences \\ and \"
static char *stripEscapes(char *s)
{
    char *src = s + 1, *dst = s;
    while (true)
    {
        char c = *src++;
        if ((c == '\\') && ((*src == '\\') || (*src == '"')))
            c = *src++;
        else if (c == '"')
            break;
        *dst++ = c;
    }
    *dst = '\0';
    return s;
}



